import React from 'react'
import { Link} from 'react-router-dom';
import img2 from './Images/img2.jpeg'
import img3 from './Images/img3.JPG'

export default function Second() {
  return (
    <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-pink-900 via-green-600 to-pink-300 p-4">  


        <img
          src={img2}
          alt="Anniversary"
          className="rounded-lg shadow *:-lg w-80 h-auto mb-8"
        />
        <img
          src={img3}
          alt="Anniversary"
          className="rounded-lg shadow *:-lg w-80 h-auto mb-8"
        />

        
      </div>
  )
}
